import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // IG_REG_013: Macro for interacting with essential elements

    // 1. Wait for and interact with the main search input (by ID)
    await page.waitForSelector('#mainSearchInput', { timeout: 5000 });
    await page.click('#mainSearchInput');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_modal_open.png'));

    // 2. Wait for the search input in the modal and type a search term
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'emma');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_filled.png'));

    // 3. Wait for a user search result and click it (by text content)
    const userSelector = "//span[contains(@class, 'username') and text()='emma_davis']";
    await page.waitForSelector(userSelector, { timeout: 5000 });
    await page.click(userSelector);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_user_profile_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_user_profile_open.png'));

    // 4. Open the "Create" modal (by nav button class)
    await page.waitForSelector('.create-btn', { timeout: 5000 });
    await page.click('.create-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_create_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_create_modal_open.png'));

    // 5. Click the "Select from computer" button (by button text)
    await page.waitForSelector('button.select-computer-btn', { timeout: 5000 });
    // Do not upload a file, just click the button to trigger file input
    await page.click('button.select-computer-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_file_input_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_file_input_clicked.png'));

    // 6. Close the create modal (by close-modal class, pick the visible one)
    const closeModalBtn = await page.$$('.close-modal');
    for (const btn of closeModalBtn) {
      if (await btn.isVisible()) {
        await btn.click();
        break;
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_create_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_create_modal_closed.png'));

    // 7. Interact with a "Follow" button in the suggestions (by class and text)
    await page.waitForSelector('.follow-btn', { timeout: 5000 });
    const followBtns = await page.$$('.follow-btn');
    let followBtnText = '';
    for (const btn of followBtns) {
      if (await btn.isVisible()) {
        followBtnText = await btn.textContent();
        await btn.click();
        break;
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_8_follow_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_8_follow_clicked.png'));

    // 8. Toggle the private account checkbox (by ID)
    await page.waitForSelector('#privateAccountToggle', { timeout: 5000 });
    const isChecked = await page.isChecked('#privateAccountToggle');
    await page.click('#privateAccountToggle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_9_private_toggle.png') });
    screenshots.push(path.join(screenshotsDir, 'step_9_private_toggle.png'));

    // 9. Open the notifications modal (by nav button class)
    await page.waitForSelector('.notifications-btn', { timeout: 5000 });
    await page.click('.notifications-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_10_notifications_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_10_notifications_modal.png'));

    // 10. Extract some data to verify
    const searchInputValue = await page.$eval('#searchInput', el => el.value);
    const privateToggleChecked = await page.isChecked('#privateAccountToggle');
    const followBtnAfter = await page.$eval('.follow-btn', el => el.textContent);

    return {
      success: true,
      action: "Interacted with essential Instagram clone elements: search, profile, create, follow, toggle private, notifications.",
      extractedData: {
        searchInputValue,
        privateToggleChecked,
        followBtnInitial: followBtnText,
        followBtnAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
